function delete_queue(index){$.ajax({url:url_ajax_delete+"/"+arrId[index],type:"POST",dataType:"JSON",success:function(data){index++;if(index>=arrId.length){arrId=[];remove_checked_table();swal.close();reload_table();}else{delete_queue(index);}}});}
